/*Table structure for table `characterlist` */

DROP TABLE IF EXISTS `characterlist`;

CREATE TABLE `characterlist` (
  `ID_character` bigint(10) NOT NULL AUTO_INCREMENT,
  `Job_character` varchar(10) DEFAULT NULL,
  `Hp` bigint(10) DEFAULT NULL,
  `Attack` bigint(10) DEFAULT NULL,
  `Defend` bigint(10) DEFAULT NULL,
  PRIMARY KEY (`ID_character`),
  UNIQUE KEY `ID_character` (`ID_character`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;

